import { useState } from 'react';

export default function TemperatureSlider() {
  const [temperature, setTemperature] = useState(25); // Initial temperature value

  const handleSliderChange = (event) => {
    setTemperature(event.target.value);
  };

  const handleInputChange = (event) => {
    setTemperature(event.target.value);
  };

  return (
    <div className="flex items-center">
        <div class="w-50">
            <input type="number"
                min="0"
                max="1"
                step="0.01"
                value={temperature}
                onChange={handleInputChange}
                    class="w-full h-5 rounded-lg appearance-none cursor-pointer" />
            <input type="range"
                min="0"
                max="1"
                value={temperature}
                onChange={handleSliderChange} class="block mb-2 text-sm font-medium text-gray-900 dark:text-white" />
        </div>
    </div>


  );
}
